import React, {Component} from "react"
import "./index.css"

function Item(props){

	return(
		<div>
			<p>{props.num.id}. {props.num.task}</p>
			<input type="button" value="Add item" className="buttonAdd"
			 onClick={props.makeChange(props.num.id)} />

			<hr></hr>
		</div>

	);
}

export default Item
